import React from "react";
import greeting from '../images/greeting.png'

class Main extends React.Component{
    render(){
        return(
            <main>
                <section className="greeting">
                    div>
                    <span className="nameSchool">#Онлайн школа «Квадрат»</span>

                    <h1><span>Подготовим ученика к экзамену <b>на 100%</b></span></h1>

                    <span className="fa fa-check-circle check"><span className="plus">Онлайн занятия</span></span> 
                    <br/>
                    <span className="fa fa-check-circle check"><span className="plus">Индивидуальный формат</span></span>
                    <br/>
                    <span className="fa fa-check-circle check"><span className="plus">Квалифицированные педагоги</span></span>
                    <br/>
                    <span className="fa fa-check-circle check"><span className="plus">Гарантия сдачи экзамена по договору</span></span>
                    <br/>

                    <button className="singUp">Записаться на пробный урок</button>
                    
                    <img className='imgGreeting' src={greeting}/>
                </section>

            </main>
        )
    }
}



export default Main;
